var t=Ember.HTMLBars.template({id:"bNmpkC+0",block:'{"symbols":[],"statements":[[8,"link-to",[[24,0,"gbm-back-button"]],[["@route"],["index"]],[["default"],[{"statements":[[2,"Back to Jonathan\'s Profile"]],"parameters":[]}]]],[2,"\\n\\n"],[10,"div"],[14,0,"container-fluid text-center py-5 px-3"],[12],[2,"\\n  "],[10,"div"],[14,0,"row"],[12],[2,"\\n    "],[10,"div"],[14,0,"col my-3"],[12],[2,"\\n      "],[10,"a"],[14,6,"https://github.com/NathanJang/MeowlWatch"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[12],[2,"\\n        "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/meowlwatch-logo-hd-0086f16fbe57c07e0697508d9726be45.png"],[14,0,"gbm-icon"],[14,"alt","App icon"],[12],[13],[2,"\\n      "],[13],[2,"\\n    "],[13],[2,"\\n  "],[13],[2,"\\n  "],[10,"div"],[14,0,"row my-2"],[12],[2,"\\n    "],[10,"div"],[14,0,"col"],[12],[2,"\\n      "],[10,"h2"],[12],[2,"\\n        Goodbye, MeowlWatch üëã\\n      "],[13],[2,"\\n      "],[10,"p"],[14,0,"text-muted"],[12],[2,"\\n        Jonathan Chan\\n      "],[13],[2,"\\n    "],[13],[2,"\\n  "],[13],[2,"\\n  "],[10,"div"],[14,0,"row justify-content-center text-left"],[12],[2,"\\n    "],[10,"div"],[14,0,"col-md-9 col-lg-8"],[12],[2,"\\n      "],[10,"p"],[12],[10,"em"],[12],[2,"April 7, 2020"],[13],[13],[2,"\\n      "],[10,"p"],[14,0,"lead"],[12],[2,"\\n        TL;DR:\\n        "],[10,"a"],[14,6,"https://github.com/NathanJang/MeowlWatch"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[12],[2,"MeowlWatch"],[13],[2,"\\n        will no longer be supported or updated, due to\\n        "],[10,"a"],[14,6,"http://dining.northwestern.edu"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[12],[2,"Northwestern Dining"],[13],[2,"\'s\\n        discontinuation of web services that are essential to the app.\\n      "],[13],[2,"\\n\\n      "],[10,"div"],[14,0,"gbm-body"],[12],[2,"\\n        "],[10,"p"],[12],[2,"\\n          MeowlWatch\'s main use case is for students to check their remaining meal plan balances through the app, after signing in once.\\n          This was accomplished by polling the web version of the balance check page on Northwestern Dining\'s own website, using NetID credentials that are securely stored on the user\'s device.\\n          At the time of writing, it appears that Northwestern Dining has permanently taken down this feature on their website, meaning MeowlWatch will no longer be able to provide the balance check feature either.\\n          I am no longer able to provide a meaningful app experience without this essential feature.\\n          This, coupled with the recent closure of campus facilities, has led me to discontinue the app.\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          The rest of this post tells the story behind MeowlWatch, as a final reflection on this project that\'s become associated with my own journey at Northwestern. Perhaps its story can help you with your own project, too.\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          "],[10,"strong"],[12],[2,"\\n            Scroll to the bottom for a dope graph :)\\n          "],[13],[2,"\\n        "],[13],[2,"\\n\\n"],[2,"\\n        "],[10,"hr"],[14,0,"my-5"],[12],[13],[2,"\\n        "],[10,"p"],[12],[10,"em"],[12],[2,"6 minute read"],[13],[13],[2,"\\n\\n        "],[10,"h3"],[12],[2,"The story of the Bodge üî®"],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          It\'s been exactly three years since I first made that post on the Class of 2020 Facebook group ‚Äî a little nervous since I\'m usually a private person, but also excited to share what I made with everyone.\\n          No more than a hastily\\n          "],[10,"a"],[14,6,"https://youtu.be/lIFE7h3m40U"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[12],[2,"bodged-together"],[13],[2," "],[2,"\\n          app for me to check my own meal balances, it became obvious that this could be put to use for many more people.\\n          In a quiet little house in the suburbs of Houston, where I was visiting a friend over Spring Break in 2017, I got to work polishing it up, until it was neat enough for publication.\\n        "],[13],[2,"\\n        "],[10,"div"],[14,0,"text-center"],[12],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/2017-screenshot-1-3a515b5b684c4acf0a12c37ba6078305.png"],[14,0,"img-fluid gbm-screenshot"],[14,"alt","Screenshots from 2017."],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/2017-screenshot-2-4637f34c8e1111c053c083d05d27cf23.png"],[14,0,"img-fluid gbm-screenshot"],[14,"alt","Screenshots from 2017."],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/2017-screenshot-3-7f08e99d931738a3513234fb03587d97.png"],[14,0,"img-fluid gbm-screenshot"],[14,"alt","Screenshots from 2017."],[12],[13],[2,"\\n          "],[10,"p"],[12],[10,"small"],[12],[2,"Screenshots from 2017."],[13],[13],[2,"\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          The app was really simple at first, just a sign-in page and a simple key-value table of the user\'s remaining meal swipes.\\n          Eventually, other features got added, including directions to nearby dining locations and when they\'re open, as well as what\'s on the menu at each location.\\n          There were also certain integrations with the operating system, including the today-widget, native dark mode, some plans to include Siri integration (\\"Hey Siri, what\'s my Cat Cash balance?\\"), and an Apple Watch app.\\n          I even localised the app into Simplified and Traditional Chinese, and French.\\n          I wanted to make the app a fully-fledged iOS app experience, and definitely learned a lot about really specific parts of mobile app design and development that you just wouldn\'t think about unless you went through it.\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"Some thoughts off the top of my head:"],[13],[2,"\\n        "],[10,"ul"],[12],[2,"\\n          "],[10,"li"],[12],[2,"How do you present all this information in a clean way, but also without making the user do a single tap to get what they need? Empathy is key in design."],[13],[2,"\\n          "],[10,"li"],[12],[2,"What extra features could I add on top of the main use case, without making the app lose its focus?"],[13],[2,"\\n          "],[10,"li"],[12],[2,"How do you translate a specific, local concept like \\"meal exchange/equivalency\\" into another language, like Chinese and French?"],[13],[2,"\\n          "],[10,"li"],[12],[2,"How do you balance the wants of the user, like an Android version, with my selfish want to implement niche things like localisation and iOS integration, instead? Sorry, user :)"],[13],[2,"\\n          "],[10,"li"],[12],[2,"Is this entrepreneurship, a public service, or my own playground? It definitely didn\'t earn any money."],[13],[2,"\\n          "],[10,"li"],[12],[2,"Turns out Apple is pretty strict when it comes to In-App Purchases, as frustrating as it was to work with such a buggy library."],[13],[2,"\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          The code has gotten messy from years of me throwing features in, here and there.\\n          It might be a good thing that I can spare someone the torment of trying to pick up this project.\\n          That being said, I would never have been able to launch this if I waited until it was perfect ‚Äî it would never be.\\n          Sometimes you just need to lower your impossible standards to make progress, and that\'s okay.\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          And with that, this is what I eventually came up with, through many iterations:\\n        "],[13],[2,"\\n        "],[10,"div"],[14,0,"text-center"],[12],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-1-a5674693e98bcae0659b668429b38314.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-2-51d891639b53723885fed17be293ac2a.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-3-ea5273582c289a3d15e71e0de446c0c6.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-4-ccf9c60ed38914ef7d702db5ad0216ec.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-5-0978ca81ec69b564b07803c49b990305.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/screenshot-6-57790d5d5b08d22e655d4eb7baab06ca.png"],[14,0,"gbm-screenshot"],[14,"alt","Screenshot of app"],[12],[13],[2,"\\n          "],[10,"p"],[12],[10,"small"],[12],[2,"Screenshots of the final version."],[13],[13],[2,"\\n        "],[13],[2,"\\n\\n        "],[10,"h3"],[12],[2,"Looking back üëÄ"],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          I never expected it to get this far, at all.\\n          The way the app pulled meal balance data is undocumented at best, and criminal at worst.\\n          At one point, I tried to get Northwestern Dining to at least help me advertise the app, but that discussion didn\'t go anywhere, so the app stayed unsanctioned.\\n          I half-expected an inevitable strongly-worded letter from someone about unauthorised use of the school network, considering a good amount of traffic to their server would have been from my users.\\n          That letter never came, though, to my relief.\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          Maybe at some point someone developed a routine to check their Equivalency balance every week before they expired.\\n          Maybe someone got crazy tipsy but still had their wits together to check on their points before buying out the chips and salsa shelf at Lisa\'s.\\n          These stories, I\'ll never know, but I sincerely hope that this app has been useful to someone out there.\\n          If you have a story, "],[8,"link-to",[],[["@route"],["index"]],[["default"],[{"statements":[[2,"let me know"]],"parameters":[]}]]],[2,"! I\'d love to hear it.\\n        "],[13],[2,"\\n\\n        "],[10,"div"],[14,0,"text-center"],[12],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/app-store-reviews-3b8d464a7968d8344261e5d60babe1dc.png"],[14,0,"gbm-info-image"],[14,"alt","Screenshot of App Store reviews"],[12],[13],[2,"\\n          "],[10,"p"],[12],[10,"small"],[12],[2,"Screenshot of App Store reviews."],[13],[13],[2,"\\n        "],[13],[2,"\\n\\n        "],[10,"p"],[12],[2,"\\n          Thanks are due to my friends and family, who empowered me to keep up with this project.\\n          I couldn\'t have done this without their support.\\n        "],[13],[2,"\\n\\n        "],[10,"h3"],[12],[2,"Looking forward üëè"],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          There are many other app opportunities in on-campus food that MeowlWatch could have ventured into.\\n          I challenge anyone able, and still participating on campus, to make something that can make the lives of those around you better.\\n          Some ideas:\\n        "],[13],[2,"\\n        "],[10,"ul"],[12],[2,"\\n          "],[10,"li"],[12],[2,"An app to distribute your student group\'s leftovers from catering."],[13],[2,"\\n          "],[10,"li"],[12],[2,"An app to offer meal swipes to students who may not be food-secure."],[13],[2,"\\n          "],[10,"li"],[12],[2,"An app for students to offer to pick up food for others in the same dorm, from a restaurant that they were going to anyway."],[13],[2,"\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          The\\n          "],[10,"a"],[14,6,"https://github.com/NathanJang/MeowlWatch"],[14,"target","_blank"],[14,"rel","noopener noreferrer"],[12],[2,"source code"],[13],[2,"\\n          will remain available online for reference only.\\n          If you\'d like to fork this project, please let me know!\\n        "],[13],[2,"\\n\\n        "],[10,"h3"],[12],[2,"Technical FAQ ü§ì"],[13],[2,"\\n        "],[10,"p"],[12],[10,"em"],[12],[2,"How did you pull user data from Northwestern?"],[13],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          On the web page, the browser makes a series of HTTP GET/POST requests to take the user through the NUIT SSO flow.\\n          All I did was step through it, mimic it with code, and then parse the response into the app.\\n          So, yes, probably against their TOS.\\n          I suspect this approach won\'t work anymore if Northwestern ups their security, like with MFA, so future projects like this should definitely check in with NUIT first.\\n        "],[13],[2,"\\n\\n        "],[10,"p"],[12],[10,"em"],[12],[2,"How much money did you make from this?"],[13],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          Net loss.\\n          It cost $100 per year to host stuff on the App Store, ad revenue and tips couldn\'t make up for it, and I couldn\'t be bothered to look for other revenue streams.\\n          I did have entrepreneurial plans at first, but I made it closer to a public utility as time went on.\\n          I kept it up for as long as people were using it :)\\n        "],[13],[2,"\\n\\n        "],[10,"h3"],[12],[2,"Finishing Stats üèÅ"],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          I am incredibly humbled that MeowlWatch has had, through its three-year lifetime, since launching in 2017, on a campus of about 8,000 undergrads:\\n        "],[13],[2,"\\n        "],[10,"ul"],[12],[2,"\\n          "],[10,"li"],[12],[2,"More than 8,000 unique downloads"],[13],[2,"\\n          "],[10,"li"],[12],[2,"A few thousand weekly app sessions (estimated), before campus closure"],[13],[2,"\\n          "],[10,"li"],[12],[2,"More than 123,000 lifetime opt-in app sessions"],[13],[2,"\\n          "],[10,"li"],[12],[2,"More than 140,000 impressions on the App Store"],[13],[2,"\\n          "],[10,"li"],[12],[2,"4.9 out of 5 stars on the App Store, over 50 reviews"],[13],[2,"\\n          "],[10,"li"],[12],[2,"Dozens of users who chose to support the app financially"],[13],[2,"\\n        "],[13],[2,"\\n        "],[10,"div"],[14,0,"text-center"],[12],[2,"\\n          "],[10,"img"],[14,"src","/assets/goodbye-meowlwatch/asc-daily-users-0ad7dec1cb3e3eacdfbef67c5aec40eb.png"],[14,0,"gbm-info-image"],[14,"alt","Graph of opt-in daily users since 2017."],[12],[13],[2,"\\n          "],[10,"p"],[12],[10,"small"],[12],[2,"Graph of opt-in daily app sessions since 2017, coinciding with the quarter system calendar."],[13],[13],[2,"\\n        "],[13],[2,"\\n        "],[10,"p"],[12],[2,"\\n          Thanks to everyone for your support!\\n          Take care.\\n        "],[13],[2,"\\n      "],[13],[2,"\\n    "],[13],[2,"\\n  "],[13],[2,"\\n"],[13]],"hasEval":false,"upvars":[]}',meta:{moduleName:"jonathanchan.me/templates/goodbye-meowlwatch.hbs"}})
